
import json

class Connections():
    def __init__(self, oid, id, type, is_available, points):
        self.oid = oid
        self.id = id
        self.type = type
        self.is_available = is_available
        self.points = points
    
class Point():
    def __init__(self, x, y, theta, index, levels=None, name=""):
        self.x = x
        self.y = y
        self.theta = theta
        self.index = index
        self.name = name
        self.levels = levels
        self.connections = {}
        
class Path():
    def __init__(self, name):
        self.name = name
        self.points = {}
    def append_point(self, point):
        '''
        Append a point to the path
        '''
        if point.name != "":
            self.points[point.name] = point
        else:
            self.points[str(point.index)] = point
    def del_point(self, name):
        del self.points[name]
    
class Map():
    def __init__(self, name, type=None, level=1):
        self.name = name
        self.paths = {}
        self.type = type
        self.level = level
    def append_path(self, path):
        '''
        Append a path to the map
        '''
        self.paths[path.name] = path
    def del_path(self, name):
        del self.paths[name]
    def set_level(self, level):
        self.level = level
        
def from_json_to_map(json):
    maps = {}
    for item in json['points']:
        point = Point(item['x'], item['y'], item['theta'], item['index'], item.get('level', None), item['name'])
        path = Path(item['path'])
        map_name = item['map']
        path_name = item['path']
        if map_name not in maps:
            map = Map(map_name, item.get('type', None), item.get('level', None))
            maps[map.name] = map
            path.append_point(point)
            map.append_path(path)
        elif path_name not in maps[map_name].paths:
            map.append_path(path)
        else:
            maps[map_name].paths[path.name].append_point(point)
    return maps
            
